def solve(L):
    dp = [[0 for _ in range(L+1)] for _ in range(2)]
    dp[0][0] = 1
    for i in range(1, L+1):
        dp[i & 1][0] = dp[(i & 1) ^ 1][0]
        dp[i & 1][i] = dp[(i & 1) ^ 1][i-1]
        for j in range(1, i):
            dp[i & 1][j] = (dp[(i & 1) ^ 1][j-1] + dp[(i & 1) ^ 1][i-j]) % MOD
    return sum(dp[L & 1]) % MOD

