    if node == len(adj):
        return flow
    for i in range(len(adj[node])):
        if adj[node][i] == 1 and i != parent:
            if cap[node][i] == 0:
                continue
            flow = dfs(i, node, adj, cap, flow)
            if flow != 0:
                cap[node][i] -= 1
                cap[i][node] += 1
                return flow
    return 0


def max_flow(adj, cap, flow):
