from collections import deque

def bfs(graph, start):
    visited = set()
    queue = deque([start])
    visited.add(start)
    while queue:
        node = queue.popleft()
        for neighbor, weight in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append(neighbor)
    return visited

def min_range(graph):
    visited = set()
    for node in graph:
        if node not in visited:
            visited |= bfs(graph, node)
    return max(graph[node][0][1] for node in graph if node in visited)

