class Solution:
    def compareVersion(self, version1: str, version2: str) -> int:
        v1 = list(map(int, version1.split('.')))
        v2 = list(map(int, version2.split('.')))
        for i in range(max(len(v1), len(v2))):
            if i >= len(v1):
                return -1
            if i >= len(v2):
                return 1
            if v1[i] > v2[i]:
                return 1
            if v1[i] < v2[i]:
                return -1
        return 0

