def sieve(n):
    prime = [True for i in range(n+1)]
    p = 2
    while (p * p <= n):
        if (prime[p] == True):
            for i in range(p * 2, n+1, p):
                prime[i] = False
        p += 1
    return prime


def upperbound(s, e, ar, x):
    while s <= e:
        m = s+(e-s)//2
        if ar[m] <= x:
            s = m+1
        else:
            e = m-1
    return s


def lowerbound(s, e, ar, x):
    while s <= e:
        m = s+(e-s)//2
        if ar[m] >= x:
            e = m-1
        else:
            s = m+1
    return e+1


def power(a, b, curr_mod):
    if b == 0:
        return 1
    temp = power(a, b//2, curr_mod) % curr_mod
    if b % 2 == 0:
        return (temp*temp) % curr_mod
    else:
        return (((temp*temp) % curr_mod)*a) % curr_mod


