def word_ladder(start, end, word_set):
    queue = [(start, 0)]
    seen = set([start])
    while queue:
        word, step = queue.pop(0)
        if word == end:
            return word, step
        for i in range(len(word)):
            for c in 'ABCDEFGHIJKLMNOPQRSTUVWXYZ':
                next_word = word[:i] + c + word[i+1:]
                if next_word in word_set and next_word not in seen:
                    queue.append((next_word, step+1))
                    seen.add(next_word)
    return None, -1

