def solve(n):
    if n % 4 == 2 or n % 4 == 3:
        return 'impossible'
    m = math.floor(math.sqrt(n + 1)) + 1
    k = math.floor(math.sqrt(n))
    if (m * m - k * k) == n:
        return '{} {}'.format(m, k)
    else:
        return solve(n - k * k)


