from math import sqrt


def is_prime(n):
    if n == 1:
        return False
    for i in range(2, int(sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True


def prime_factors(n):
    if is_prime(n):
        return [n]
    else:
        return [i for i in range(2, int(sqrt(n)) + 1) if n % i == 0] + \
            [n // i for i in range(2, int(sqrt(n)) + 1) if n % i == 0]


def prime_factorization(n):
    return {i: n // i for i in prime_factors(n)}


def prime_factorization_count(n):
    return {i: n // i for i in prime_factors(n)}


def prime_factorization_dict(n):
    return {i: 0 for i in prime_factors(n)}

